import { Component, Input } from '@angular/core';
import { Repuesto } from '../../shared/repuesto';

@Component({
  selector: 'app-repuesto-item',
  templateUrl: './repuesto-item.component.html',
  styleUrls: ['./repuesto-item.component.css'],
})
export class RepuestoItemComponent {
  @Input() repuesto: Repuesto = {
    id: 0,
    title: '',
    price: 0,
    shortDescription: '',
    description: '',
    categories: [''],
    image: '',
  };
}
<figure class="figure">
  <img src="{{repuesto.image}}" class="figure-img img-fluid rounded">
  <figcaption class="figure-caption">
    <h5><a [routerLink]="['/repuestos', repuesto.id]">{{repuesto.title}}</a>
      <span>{{repuesto.price }}</span>
    </h5>
    <p>{{repuesto.shortDescription}}</p>
  </figcaption>
</figure>
